import React from 'react';
import { Box, Typography } from '@mui/material';

export const Statute: React.FC = () => {
  return (
    <Box
      maxWidth={1000}
      mx="auto"
      my={5}
      px={2}
      color="#424242"
      sx={{ minHeight: '100vh' }}
    >
      <Typography variant="h4" fontWeight="bold" mb={6} textAlign={"left"}>
        Estatuto
      </Typography>
      <Typography paragraph lineHeight={2} textAlign={'justify'}>
        Na Assembleia Geral Extraordinária (AGE) de 20 de novembro de 2023,
        foram definidos os tópicos, anteriormente debatidos na AGE de
        21/09/2023. Assim, o Clube Poçoscaldense de Vôo Livre - CPVL tem um novo
        Estatuto aprovado na gestão 2022/2023 e registrado em cartório no dia 21
        de novembro de 2023.
      </Typography>
      <Typography paragraph textAlign={'justify'}>
        O CPVL agradece a todos que contribuíram para a atualização do estatuto
        e reforça que a participação dos associados nas assembleias é de extrema
        importância, pois entende que todos têm algo a contribuir com o clube.
      </Typography>
    </Box>
  );
};
